import logo from './logo.svg';
import './App.css';
import NavBar from './components/NavBar/NavBar';
import ItemListContainer from './components/CartWidget/ItemListContainer.js'
import Item from './components/';
import imageInmo from "./components/imagenes/26005243813655108044425939761438451326546227081000691770463139220883965592942.jpg";


function App() {
  return (

      <><NavBar /><ItemListContainer MensajeProvisional="Aguarde un momento, aquí aparecerá nuestro catalogo" /><item title="Departamento En venta" id="0" picture={imageInmo} price="U$S 200.000" /> </>

  );
}

export default App;
